import axios from "axios"
export const signupWithEmailAndPassword = (details, callback) => {
    return async (dispatch) => {
        try {
            const response = await axios.post(`https://identitytoolkit.googleapis.com/v1/accounts:signUp?key=AIzaSyCyUo859e-kKU0NkpuXKa8zuIHxsWR67Vc`,
                {
                    email: details.email,
                    password: details.password,
                    returnSecureToken: true
                })
            dispatch({
                type: "SIGNUP",
                payload: response.data
            })
            return callback(response.data)

        } catch (error) {
            console.log(error)
            return callback({
                error: true,
                response: error.response
            })
        }
    }



}
